column8:
国内寒冷地仕様のクリスタルカットレンズのリアフォグをベースに内側に高輝度チップLED6個、外側に高輝度チップLED6個をインストール。バルブとは違う均一で明るい発光を実現。それぞれ配線が独立しているのでポジション/ストップ連動等お客様の好みで配線して下さい。 <br><br>●左右2個セット ●LED個数24個使用<br><br>※LEDには極性がありますので＋－を正しく接続しないと光りません。 <br><br>対応車種：LEXUS RX / MCU/ACU30系 ハリアー <br><br>　<br><br>ランプ、レンズ/サイドマーカー<tr><td colspan="2">
